import React from "react";
import "../styles/Stores.css";

function Stores() {
  const stores = [
    "Restaurante do Baixinho",
    "Vip Sushi",
    "Sabor da Aldeia",
    "McDonald's",
  ];

  return (
    <div className="stores">
      {stores.map((store, index) => (
        <div key={index} className="store-item">
          {store}
        </div>
      ))}
    </div>
  );
}

export default Stores;
